import React from "react";
import Navbar from "./Navbar";
import web from '../../images/akatsuki.png'

const Home = () => {
  return (
    <>
      <section id="header" className="section">
        <div className="container-fluid nav_bg">
          <div className="row">
            <div className="col-10 mx-auto">

                <div className="col-md-6 pt-5 pt-lg-0 order-2 order-lg-1">
                    <h1>Hire some of the efficients ninjas from <strong className="brandname">Konoha</strong></h1>
                    <h5 className="my-2">We provide the best ninjas for each ranked missions</h5>
                    <div className="mt-3">
                        <a href="" className=" btn btn-outline-warning makebtn  ">Hire them!</a>
                    </div>
                </div>

                <div className="col-lg-6 order-1 order-lg-2 header-img">
                    <img src={web} className="img-fluid-animated" alt = "homeimg" />
                </div>

            </div>
          </div>
        </div>
        
      </section>
    </>
  );
};
export default Home;
